    if (seconds.secTotal > 0) {
      setTimeout(() => setSeconds(seconds => ({...seconds, secTotal: seconds.secTotal - 1, sec1: secSplit[0], sec2: secSplit[1]})), 1000);
    }
    if(seconds.secTotal === 0) {
      setMinutes(minutes => ({
        ...minutes,
        minTotal: minutes.minTotal - 1
      }))
      setSeconds(seconds => ({
        ...seconds,
        secTotal: 59
